#include <stdio.h>
#include <stdlib.h>
#define SWAP(x,y) {int t; t = x; x = y; y = t;} 
//selection sort

void selection_sort(int a[],int size){
	int I,j;
	for(I=0;I<size;I++){
		int temp=a[I];
		int temploc=I;
		for(j=I;j<size;j++){
			if(a[j]<temp){
				temp=a[j];
				temploc=j;
			}
		}
		a[temploc]=a[I];
		a[I]=temp;
	}
}
void insertion_sort(int a[],int size){
	int I,j;
	for(I=0;I<size;I++){
		for(j=I;j>0;j--){
			if(a[j]<a[j-1]){
				int temp=a[j-1];
				a[j-1]=a[j];
				a[j]=temp;
			}
		}
	}
}
void merge(int arr[], int l, int m, int r){
    int i, j, k;
    int n1 = m - l + 1;
    int n2 = r - m;
 
    int L[n1], R[n2];
 
    for (i = 0; i < n1; i++)
        L[i] = arr[l + i];
    for (j = 0; j < n2; j++)
        R[j] = arr[m + 1 + j];

    i = 0; // Initial index of first subarray
    j = 0; // Initial index of second subarray
    k = l; // Initial index of merged subarray
    while (i < n1 && j < n2) {
        if (L[i] <= R[j]) {
            arr[k] = L[i];
            i++;
        }
        else {
            arr[k] = R[j];
            j++;
        }
        k++;
    }
    while (i < n1) {
        arr[k] = L[i];
        i++;
        k++;
    }
    while (j < n2) {
        arr[k] = R[j];
        j++;
        k++;
    }
}
void merge_sort(int arr[], int l, int r){
    if (l < r) {

        int m = l + (r - l) / 2;

        merge_sort(arr, l, m);
        merge_sort(arr, m + 1, r);
 
        merge(arr, l, m, r);
    }
}
int partition(int number[], int left, int right) { 
    int i = left - 1; 
    int j;
    for(j = left; j < right; j++) { 
        if(number[j] <= number[right]) { 
            i++; 
            SWAP(number[i], number[j]); 
        } 
    } 

    SWAP(number[i+1], number[right]); 
    return i+1; 
} 
void quick_sort(int number[], int left, int right){ 
    if(left < right) { 
        int q = partition(number, left, right); 
        quick_sort(number, left, q-1); 
        quick_sort(number, q+1, right); 
    } 
}
void heap_sort(int* num, int len, int(*compar)(int, int)) {
    heapTree(num, len, compar);
    selectFromHeap(num, len, compar); 
}
void heapTree(int* num, int len, int(*compar)(int, int)) { 
    int i, end;
    for(i = 1, end = len + 1; i < end; i++) { bubbleLeaf(num, i, compar); }
}
int ascending(int a, int b) { return a - b; }
void selectFromHeap(int* num, int len, int(*comp)(int, int)) {
    int end;
    for(end = len; end > 1; end--) {
        SWAP(num[1 - 1], num[end - 1]);
        bubbleRoot(num, end, comp);
    }
}
void bubbleLeaf(int* num, int eleIdx, int(*compar)(int, int)) {
    int childIdx, parentIdx;
    for(childIdx = eleIdx, parentIdx = eleIdx / 2;
        isBubbleable(num, childIdx, parentIdx, compar);
        childIdx = parentIdx, parentIdx = childIdx / 2) {
         SWAP(num[parentIdx - 1], num[childIdx - 1]); 
    }
}
int isBubbleable(int* num, int childIdx, int parentIdx, int(*compar)(int, int)) {
    return childIdx > 1 && 
           compar(num[parentIdx - 1], num[childIdx - 1]) < 0;
}
void bubbleRoot(int* num, int end, int(*comp)(int, int)) {
    int parentIdx, childIdx;
    for(parentIdx = 0 + 1, 
        childIdx = idxFromChilds(num, parentIdx, end, comp);
        childIdx < end && 
        comp(num[childIdx - 1], num[parentIdx - 1]) > 0; 
        parentIdx = childIdx, 
        childIdx = idxFromChilds(num, parentIdx, end, comp)) {
        SWAP(num[parentIdx - 1], num[childIdx - 1]); 
    }    
}
int idxFromChilds(int* num, int parentIdx, int end, int(*comp)(int, int)) {
   int childIdx = parentIdx * 2;
   return isRightLeafSuitable(num, childIdx, end, comp) ? 
              childIdx + 1 : childIdx;
}
int isRightLeafSuitable(int* num, int childIdx, int end, int(*comp)(int, int)) {
    return childIdx < end - 1 && 
           comp(num[childIdx + 1 - 1], num[childIdx - 1]) > 0;
}

int getMax(int arr[], int n) {
    int mx = arr[0];
    int i;
    for (i = 1; i < n; i++)
        if (arr[i] > mx)
            mx = arr[i];
    return mx;
}
 
void countSort(int arr[], int n, int exp) {
    int output[n]; // output array
    int i, count[30000] = { 0 };
 
    // Store count of occurrences in count[]
    for (i = 0; i < n; i++)
        count[(arr[i] / exp) % 10]++;
 
    for (i = 1; i < 10; i++)
        count[i] += count[i - 1];
 
    // Build the output array
    for (i = n - 1; i >= 0; i--) {
        output[count[(arr[i] / exp) % 10] - 1] = arr[i];
        count[(arr[i] / exp) % 10]--;
    }
 
    for (i = 0; i < n; i++)
        arr[i] = output[i];
}
 
// The main function to that sorts arr[] of size n using Radix Sort
void radix_sort(int arr[], int n) {
    int m = getMax(arr, n);
 
    int exp;
    for (exp = 1; m / exp > 0; exp *= 10)
        countSort(arr, n, exp);
}
